pragma solidity^0.8.26;

contract FundMe{

    uint256 public minUsd = 50;

    //function to get funding from public
    function fund() public payable{
        //to send minimum amount of usd 
        require(msg.value> minUsd, "Not enough funds bro!");
    }

}

